import React from 'react'
import CreateList from './createList'
import SingleTodo from './singleTodo'

const Home = () => {
  const [todos,setTodos]=useState()

  useEffect(()=>{
    fetch(' http://localhost:8000/posts')
    .then((res)=> {
      return res.json()
    })
    .then((data)=> {
        // console.log(data)
        setTodos(data)
    })
  },[]);

  // const handleDelete =()=>{

  // };

  // const handleUpdate =()=>{

  // };
  return (
    <div className="container">

      <CreateList />

      <SingleTodo todos={todos} />

</div>
  )
}

export default Home
